import React from "react";
import CsvGraphPlotter from "./CsvGraphPlotter";

function App() {
  return (
    <div>
      <header style={{ textAlign: "center", padding: "20px", backgroundColor: "#f0f0f0" }}>
        <h1>Sensorless Sensing: CSV Graph Viewer</h1>
      </header>
      <CsvGraphPlotter />
    </div>
  );
}

export default App;
